import React from 'react';
import './App.css';

function App() {
  return (
    <div className='main-container'>
      <div className='title'>Daily To-Do List</div>
      <div className="main-list-container">
        <ul>
          <input className="Input" type='text' placeholder='Add todo item'></input></ul>
      </div>
      <button>Add</button>
    </div>
  );
}

export default App;
